import './App.css';

import Calendar from "./components/Calendar/Calendar"; 
import LeftTaskBar from "./components/LeftTaskBar/LeftTaskBar"; 
import RightTaskBar from './components/RightTaskBar/RightTaskBar';
import TaskDictionary from './utility/TaskDictionary';
import Task from './utility/Task'; 

function App() {

  let date = TaskDictionary.convertDate(new Date(Date.now())); 

  TaskDictionary.addTask(null, new Task(null, "test")); 


  return (
     // This is all a placeholder for Calendar component
    <div className="App">
      <h2 id="Title">Johu's Calendar</h2>
      <br></br>

      <div id="principal-row">


      <div class="indent"></div>

        <LeftTaskBar></LeftTaskBar>



        <div class="horiz-seperator"></div>

        <Calendar id="calendar"></Calendar>

        <div class="horiz-seperator"></div>

        <RightTaskBar id="right-tb"></RightTaskBar>


      </div>



    </div>
  );
}

export default App;
